import{_ as r,r as h,o as c,c as s,b as a,d as e,e as l,a as i}from"./app-c80e1060.js";const o="/assets/0按范围打印-59308479.png",t="/assets/0PDF打印选项-5434bfe7.png",n="/assets/0打印样式编辑器-e2afdf12.png",p="/assets/0PDF打印选项_添加纸张-762af3d9.png",u="/assets/0PDF打印选项_按图框-360e3af6.png",m="/assets/0按文件打印-03f13682.png",g="/assets/0高清截图-9a3de4d1.png",f="/assets/0插入DWG-08d87044.png",_="/assets/0按图层导出DWG-c2734902.png",b="/assets/0按范围导出DWG-6e4823bf.png",x="/assets/0按字段拆分图层-16f5f1e6.png",D="/assets/0矩形分幅-19559af8.png",G="/assets/0一百万地形图分幅和编号-12022ce4.png",F="/assets/0梯形分幅-3ea8cb96.png",W={},k=i('<h1 id="通用工具" tabindex="-1"><a class="header-anchor" href="#通用工具" aria-hidden="true">#</a> 通用工具</h1><p>通用工具是系列工具的集合，诸如裁剪、打印输出、合并拆分等；</p><h2 id="裁剪工具" tabindex="-1"><a class="header-anchor" href="#裁剪工具" aria-hidden="true">#</a> 裁剪工具</h2><ul><li><p>保留指定区域</p><p>命令 <code>CEK</code>，裁剪并删除所选范围外所有要素，只保留范围内要素。</p></li><li><p>删除指定区域</p><p>命令 <code>CED</code>，裁剪并删除所选范围内所有要素。</p></li><li><p>指定区域存盘</p><p>命令 <code>CES</code>，按所选范围裁剪要素，并将其另存为单个文件。</p></li></ul><h2 id="打印pdf" tabindex="-1"><a class="header-anchor" href="#打印pdf" aria-hidden="true">#</a> 打印PDF</h2><p><code>打印PDF</code> 是对系统打印机的扩展，既可拾取范围快速打印，也可批量多图框多文件打印，操作界面如下。</p><p><img src="'+o+'" alt="image"></p><h4 id="按范围打印" tabindex="-1"><a class="header-anchor" href="#按范围打印" aria-hidden="true">#</a> 按范围打印</h4><p>命令 <code>BPP</code>，按所拾取的范围打印，适用于单幅面场景</p><h5 id="打印机" tabindex="-1"><a class="header-anchor" href="#打印机" aria-hidden="true">#</a> 打印机</h5><p>默认使用 <code>DWG To PDF</code> 打印机，若需要图片，可在 <code>转为图片</code> 中进行设置。</p><h5 id="pdf选项" tabindex="-1"><a class="header-anchor" href="#pdf选项" aria-hidden="true">#</a> PDF选项</h5><p><img src="'+t+'" alt="image"></p><blockquote><ul><li><code>捕获图形中使用的字体</code>：文字将以矢量形式呈现，建议勾选。</li><li><code>将所有文字转换为几何图形</code>：文字将被转为栅格格式，精度受矢量和光栅质量影响。</li><li>部分字体捕获会导致打印的文件字符宽度错误，这时可勾选 <code>将所有文字转换为几何图形</code></li></ul></blockquote><h5 id="打印样式" tabindex="-1"><a class="header-anchor" href="#打印样式" aria-hidden="true">#</a> 打印样式</h5><p>打印样式给用户提供了很大的灵活性，用户可以设置打印样式来替代其他对象特性</p><p><img src="'+n+'" alt="image"></p><blockquote><p>打印样式可调整颜色、抖动、灰度、笔号、虚拟笔、淡显、线型、线宽、透明度、线条端点样式、线条连接样式、填充样式。</p></blockquote><h5 id="图形界限" tabindex="-1"><a class="header-anchor" href="#图形界限" aria-hidden="true">#</a> 图形界限</h5><p>将按设置的比例对目标范围进行缩放</p><h5 id="线宽" tabindex="-1"><a class="header-anchor" href="#线宽" aria-hidden="true">#</a> 线宽</h5><p>勾选后将打印线宽</p><h5 id="打印比例" tabindex="-1"><a class="header-anchor" href="#打印比例" aria-hidden="true">#</a> 打印比例</h5><p>可设置布满图纸或缩放至最近比例尺倍率，如倍率设置为100，则打印时会将比例尺缩放至能完全打印目标区域的最接近比例尺，且该比例尺为100的整数倍。</p><p>此参数可应用于一些需要精确比例尺的打印场景</p><h5 id="纸张模式" tabindex="-1"><a class="header-anchor" href="#纸张模式" aria-hidden="true">#</a> 纸张模式</h5><ul><li><p>固定纸张：将输出固定为所选的纸张大小，该模式可自行添加纸张。</p></li><li><p>自适应纸张：将按目标区域来动态调整输出的纸张大小，该模式可确保输出范围和纸张完全契合。</p><p><img src="'+p+'" alt="image-20230926105850313"></p></li><li><p>转为图片</p><ul><li>转换将在打印完成后执行，可将 <code>PDF</code> 转为图片。</li></ul></li></ul><h4 id="按图框打印" tabindex="-1"><a class="header-anchor" href="#按图框打印" aria-hidden="true">#</a> 按图框打印</h4><p>命令 <code>BPT</code>，除需指定图框和命名字段外，其他设置和 <code>按范围打印</code> 相同，适用于多幅面场景</p><p><img src="'+u+'" alt="image"></p><ul><li>按字段命名：输出的文件将按字段表达式命名</li><li>按文字命名：<code>拾取</code> 将获取两个范围，第一个是 <code>图框范围</code>，第二个用于命名的 <code>文字范围</code>，输出时将尝试获取每个图框内指定范围处的文字用于命名，没找到则按序号递增命名。</li></ul><h4 id="按文件打印" tabindex="-1"><a class="header-anchor" href="#按文件打印" aria-hidden="true">#</a> 按文件打印</h4><p>命令 <code>BPF</code>，基础设置和 <code>按范围打印</code> 相同，适用于多文件批量打印场景。</p><p><img src="'+m+'" alt="image-20230808174543685"></p><h2 id="高清截图" tabindex="-1"><a class="header-anchor" href="#高清截图" aria-hidden="true">#</a> 高清截图</h2><p>命令 <code>GQJT</code>，高清截图是对打印功能的补充，可将目标区域输出为高清图片，支持批量截取，好处是方便快捷，所见即所得。</p><p><img src="'+g+'" alt="image"></p><ul><li><h5 id="分辨率以像素为单位-有三种模式" tabindex="-1"><a class="header-anchor" href="#分辨率以像素为单位-有三种模式" aria-hidden="true">#</a> 分辨率以像素为单位，有三种模式：</h5><ul><li>锁定宽度：输出图片的宽度将被固定，高度按比例缩放。</li><li>锁定高度：输出图片的高度将被固定，宽度按比例缩放。</li><li>指定倍率：宽度和高度均按目标范围屏幕分辨率倍率缩放。</li></ul></li><li><h5 id="批量模式-也就是按图框批量截图" tabindex="-1"><a class="header-anchor" href="#批量模式-也就是按图框批量截图" aria-hidden="true">#</a> 批量模式，也就是按图框批量截图</h5><ul><li>该模式需指定图框所在图层、命名字段以及保存位置，输出图片将按字段值命名。</li><li>批量截图过程中可通过 <code>ESC</code> 取消。</li></ul></li><li><h5 id="边界缓冲" tabindex="-1"><a class="header-anchor" href="#边界缓冲" aria-hidden="true">#</a> 边界缓冲（%）</h5><p>实际输出的范围将按该参数向外/内调整，单位是目标范围长宽的百分比。</p></li><li><h5 id="白色透明" tabindex="-1"><a class="header-anchor" href="#白色透明" aria-hidden="true">#</a> 白色透明</h5><p>输出图片的白色部分将自动透明处理。</p></li><li><h5 id="保存pdf" tabindex="-1"><a class="header-anchor" href="#保存pdf" aria-hidden="true">#</a> 保存PDF</h5><p>将输出的图片转为 PDF。</p></li><li><h5 id="截取到剪切板" tabindex="-1"><a class="header-anchor" href="#截取到剪切板" aria-hidden="true">#</a> 截取到剪切板</h5><p>将截图到剪切板而非文件，方便直接粘贴使用，该设置对批量模式无效。</p></li><li><h5 id="指定底色" tabindex="-1"><a class="header-anchor" href="#指定底色" aria-hidden="true">#</a> 指定底色</h5><p>设置截图的背景色。</p></li><li><h5 id="截图方式共有三种" tabindex="-1"><a class="header-anchor" href="#截图方式共有三种" aria-hidden="true">#</a> 截图方式共有三种：</h5><ul><li>截原色图：该模式将直接截取和 CAD 窗口所见效果一致的图片。</li><li>截指定底色：按照设置的底色来改变背景色并截图。</li><li>截灰度图：按照设置的底色来改变背景色，并截取灰度图。</li></ul></li></ul><div class="custom-container warning"><p class="custom-container-title">注意</p><ul><li>理论上支持最大5亿像素截图，实际使用受限于 CAD 版本、设备内存等，过高的像素可能会导致内存溢出，且截取效率较低，请酌情使用。</li><li>若实在需要超大的图片，可使用打印工具打印为 PDF 后，再转换为图片，矢量格式的 PDF 转为图片同样高清。</li><li>高清截图仅支持模型空间。</li></ul></div><h2 id="合并拆分" tabindex="-1"><a class="header-anchor" href="#合并拆分" aria-hidden="true">#</a> 合并拆分</h2><h4 id="批量插入dwg" tabindex="-1"><a class="header-anchor" href="#批量插入dwg" aria-hidden="true">#</a> 批量插入DWG</h4><p>命令 <code>DWGIN</code>，可将多个 DWG 插入到当前文件，支持 <code>按原坐标插入</code> 和 <code>按阵列插入</code> 两种模式</p><p><img src="'+f+'" alt="image"></p><h4 id="批量导出dwg" tabindex="-1"><a class="header-anchor" href="#批量导出dwg" aria-hidden="true">#</a> 批量导出DWG</h4><p>命令 <code>DWGOUT</code>，将批量插入的DWG按图框导出为单个DWG。</p><h4 id="按图层导出dwg" tabindex="-1"><a class="header-anchor" href="#按图层导出dwg" aria-hidden="true">#</a> 按图层导出DWG</h4><p>命令 <code>DWGL</code>，按图层导出为单个DWG</p><p><img src="'+_+'" alt="image-20230809101213147"></p><h4 id="按范围导出dwg" tabindex="-1"><a class="header-anchor" href="#按范围导出dwg" aria-hidden="true">#</a> 按范围导出DWG</h4><p>命令 <code>DWGF</code>，按范围裁剪并导出DWG</p><p><img src="'+b+'" alt="image-20230809101347123"></p><h4 id="按字段拆分图层" tabindex="-1"><a class="header-anchor" href="#按字段拆分图层" aria-hidden="true">#</a> 按字段拆分图层</h4><p>命令 <code>DWGLF</code>，将图层按指定字段拆分为单个文件</p><p><img src="'+x+'" alt="image-20230809101621004"></p><ul><li><strong>按组输出</strong> ，勾选后相同字段内容的图形将被输出到同一个文件，不勾选则每个图形输出一个文件</li></ul><h2 id="分幅工具" tabindex="-1"><a class="header-anchor" href="#分幅工具" aria-hidden="true">#</a> 分幅工具</h2><h4 id="矩形分幅" tabindex="-1"><a class="header-anchor" href="#矩形分幅" aria-hidden="true">#</a> 矩形分幅</h4><p>对于大比例尺地形图，大多按纵横坐标格网线进行等间距分幅，即采用正方形分幅与编号方法。一般而言：</p><ul><li>1:5000 比例尺采用纵、横各 40cm，即实地 2km 的分幅。</li><li>1:2000、1:1000、1:500 比例采用纵、横各 50cm 分幅。</li><li>若项目区为狭长带状，为了减少接图，可采用任意分幅。</li></ul><p>图幅的编号一般采用坐标编号法。由图幅西南角坐标组成编号，1∶5000 坐标值取至km，1∶2000、1∶1000取至0.1km，1∶500取至0.01km。</p><p>命令 <code>GGG</code>，绘制矩形分幅图框</p><p><img src="'+D+'" alt="image-20230809101911581"></p><h4 id="梯形分幅" tabindex="-1"><a class="header-anchor" href="#梯形分幅" aria-hidden="true">#</a> 梯形分幅</h4>',63),P={href:"http://c.gb688.cn/bzgk/gb/showGb?type=online&hcno=30799A9AF9BFA98E77D21ABC5F0984E2",target:"_blank",rel:"noopener noreferrer"},w=i('<p><img src="'+G+'" alt="image-20230901150036801"></p><p>命令 <code>GGT</code>，设置空间参考及比例尺后即可绘制</p><p><img src="'+F+'" alt="image-20230901122632753"></p><blockquote><ul><li><p>基本比例尺地形图基于经差和纬差划分图幅，所以绘制前需要指定全局坐标系，以构建图形坐标到经纬度坐标的转换。</p></li><li><p>该功能仅在中国经纬度范围内有效。</p></li><li><p>支持1：100万，1：50万，1：25万，1：10万，1：5万，1：2.5万，1：1万，1：5千比例尺图框绘制。</p></li></ul></blockquote>',4);function B(E,C){const d=h("ExternalLinkIcon");return c(),s("div",null,[k,a("p",null,[e("绘制国家基本比例尺梯形分幅图框，1∶100 万地形图分幅和编号是采用国际标准分幅的经差 6°、纬差 4° 为一幅图，其余比例尺图幅在此基础上按规定的经差和纬差划分，参考标准"),a("a",P,[e("GB/T 13989-2012 "),l(d)]),e("。")]),w])}const q=r(W,[["render",B],["__file","07Genaral.html.vue"]]);export{q as default};
